import React, { Component } from "react";

class Title extends Component {
  constructor() {
    super();

    this.objeto = [
      {
        id: 1,
        nombre: "Carlos",
        apellido:'Rivera'
      },

      {
        id: 2,
        nombre: "Ariel",
        apellido:'Gaitan'
      },

      {
        id: 3,
        nombre: "Kendall",
      },
    ];
  }
  render() {
    return (
      <div className="Center">
        {this.objeto.map((el) => (
          <div>
            <p>{el.id}</p>
            <p>{el.nombre}</p>
          </div>
        ))}
      </div>
    );
  }
}

export default Title;
